import React from 'react';
import './scss/app.scss';
import MainPage from './components/mainPage';
import Header from './components/header';
import Footer from './components/footer';

function App() {
  return (
    <div className="wrap">
      <Header />
      <MainPage />
      <Footer />
    </div>
  );
}

export default App;
